import React from 'react'
import { useState } from "react";

function Form () {
    const [name, setName] = useState("")
    const [Url, setUrl] = useState("")
    const [occupation, setOccupation] = useState("")
    const [mobileNumber, setMobileNumber] = useState("")
    const [cellPhone, setCellPhone] = useState("")
    const [sMS, setSMS] = useState("")
    const [emailAddress, setEmailAdress] = useState("")

    const handleName = (event) => {
        setName(event.target.value)
    };
    const handleOccupation = (event) => {
        setOccupation(event.target.value)
    };
  return (
    <div>
    <form>
    <input type ="text" value = {name} placeholder= "Name of the employee" onChange = {handleName} />
    <br/>
    <input type ="text" value = {name} placeholder= "Url" onChange = {handleName} />
    <br/>
    <input type ="text" value = {name} placeholder= "Occupation" onChange = {handleName} />
    <br/>
    <input type ="text" value = {name} placeholder= "Office Mobile No." onChange = {handleName} />
    <br/>
    <input type ="text" value = {name} placeholder= "Cell-Phone No." onChange = {handleName} />
    <br/>
    <input type ="text" value = {name} placeholder= "SMS" onChange = {handleName} />
    <br/>
    <input type ="text" value = {occupation} placeholder= "Email Address" onChange = {handleOccupation} />
    <br/>
    <button>Submit</button>
    </form>
    </div>
  )
};

export default Form;
